import React, {useState} from "react";
import "./navbar.css";
import { RiMenu3Line, RiCloseLine } from "react-icons/ri";
import logo from '../../assets/GPT-3.svg'

const Menu = () => {

}

const Navbar = () => {
  const [toggleMenu, setToggleMenu] = useState(false);

  return (
    <div className="gpt3__navbar">
      <div className="gpt3__navbar-links">
        <div className="gpt3__navbar-links_logo">
          <img src={logo} alt="logo" />
        </div>
        <div className="gpt3__navbar-links_containers">
          <p><a href="#home">Home</a></p>
          <p><a href="#wgpt3">What is GPT3?</a></p>
          <p><a href="#possibilities">OpenAI</a></p>
          <p><a href="#features">Case Studies</a></p>
          <p><a href="#blog">Library</a></p>
        </div>
      </div>
      <div className="gpt3__navbar-sign">
        <p>Sign In</p>
        <button type="button">Sign Up</button>
      </div>
      <div className="gpt3__navbar-menu">
        {toggleMenu
          ? <RiCloseLine color="#fff" size={27} onClick={() => setToggleMenu(true)}/>
          : <RiMenu3Line color="#fff" size={27} onClick={() => setToggleMenu(false)}/>
        }
        {toggleMenu &&
          <div className="gpt3__navbar-menu_ container scale-up-center">
            <div className="gpt3__navbar-menu_container-links">
              {/* adding menu */}
            </div>
          </div>
        }
      </div>
    </div>
  );
};

export default Navbar;
